<html xmlns="http://www.w3.org/1999/xhtml">
<meta charset="UTF-8">
<head>
    <meta charset="UTF-8">
    <title>Season's Greetings</title>
    <meta name="viewport" content="width=device-width, initial-scale=1">
	<link href = "font/style.css" rel = "stylesheet" type = "text/css" />
    <style>
        html{
            width: 100%;
            height: 100%;
        }
        body{
            background:url(fon.png) #eaefff;
            margin: 0px;
            height: 100%;
            width: 100%;
            overflow: hidden;

        }
        #lottie{
            width:100%;
            height:100%;
            display:block;
            overflow: hidden;
            text-align: center;
            opacity: 1;
        }
        #lottie svg{
            transform: scale(0.8) !important;
            transform-origin: center center !important;
        }
        @media all and (max-width: 650px){
            #lottie svg{
                transform: scale(1) !important;
                transform-origin: center center !important;
            }
        }
		.link{
			display:block;
			width:180px;
			line-height:16px;
			padding-left:0;
			padding-right:0;
			padding-top:1px;
			padding-bottom:1px;
			text-align:center;
			position:absolute;
			right:20px;
			bottom:20px;
			background:#fff;
			border:1px solid #ffffff;
			text-decoration:none;
			color:#29314c;
			opacity:0;
			animation: show 1s 1;
			animation-fill-mode: forwards;
			-webkit-animation-delay: 19s;
			-moz-animation-delay: 19s;
			animation-delay: 19s;
			font-family:'Styrene A Web';
			font-size:12px;
		}
		@media all and (max-width: 768px){
            .link{
				right:10px;
				bottom:10px;
				/*width:97px;*/
			}
        }
		@media all and (max-width: 450px){
            .link{
				right:10px;
				bottom:10px;
				/*width:203px;*/
			}
        }
		@keyframes show{
			0%{
			opacity:0;
			}
			100% {
			opacity:1;
			}
		}
    </style>
</head>
